import React from 'react';
import leftBg from '../images/marshmallow-banner-img-1.png';
import rightBg from '../images/marshamallow-banner-img-2.png';
function Home(){
    return(
        <div className="row">
            <div className="col-3">
<img src={leftBg} alt="" />
            </div>
            <div className="col-6"></div>
            <div className="col-3">
            <img src={rightBg} alt="" />
            </div>
        </div>
    );
}
export default Home;
